  expressApi: ExpressAPI
}

export default function DashboardPage({ expressApi: DashboardPageProps }) {
  return (
    <MainLayout>
      <header>
        <h1>
          DASHBOARD
        </h1>
      </header>
    </MainLayout>
  );
}

